  input: 'TEXT,F3XN,,"Jodi - Just as a reminder of our talk on the phone 12/1/04,
    I have alerted the Burr Campaign about our excessive contribution on 10/20/04
    (#2115) in the amount of $1,000 for the 2004 General.  I have mailed today a formal
    request in writing that I also cc''d to you at the FEC.  I expect the refund check
    any day now, and will of course be notating that in the year-end report.  I apologize
    for this mistake, but I am thankful we will be rectifying within the 60 day period.  Thanks
    again for your assistance with this matter.  I also told you about two contributions
    where the campaigns never deposited the money.  Therefore, i cancelled the checks
    - #''s 2010 & 2069.  Those contributions were reported in the Oct 15th Quarterly
    Report and now are disclosed as negative contributions on this report.  Please
    do not hesitate to contact me with any questions.  Again, thanks for your assistance.  Kelly
    Knowles "'
